function Main() {
  return (
    <div>
      <div className="title">
        <div className="firstLine">
          <p className="light">Your </p>
          <p className="bold">Favorite Food</p>
        </div>
        <br />
        <div className="secondLine">
          <p className="light">Delivered </p>
          <p className="bold">Hot & Fresh</p>
        </div>
      </div>
    </div>
  );
}

export default Main;
